import {
  InstancedParticleSystemGraphic
} from "../../../BaseClasses/InstancedParticlesStarter/InstancedParticleSystemGraphic";
import {BillboardParticle} from "./BillboardParticle";

/**
 * Optionally, you can customize the graphic class used for the particle system.
 */
export class BillboardParticleSystemGraphic extends InstancedParticleSystemGraphic<BillboardParticle>{
    get particleTexture(){return "images/flameParticle.jpg"}
}
